[program:redis6379]
command=/usr/sbin/redis-server /etc/redis/redis-6379.conf
stopsignal=TERM
priority=50
autorestart=true
startsecs=10
user=redis
stdout_logfile=/var/log/redis/redis-6379.log
autostart=false

